import React, { useState } from 'react'

import './style.css'

const List = ({ items }) => {
  const [view, setView] = useState(1)
  return (
    <>
      <button onClick={()=>setView}>Vertical view</button>
      <div className={view}>
        {items.map((item, index) => {
          if (item.avatarUrl && item.avatarUrl.url) {
            return (
              <img key={index} src={item.avatarUrl.url}></img>
            )
          }
        })}
      </div>
    </>
  )
}

export default List
